// Rate limiting helper to prevent API quota exhaustion
const delay = (ms) => new Promise(resolve => setTimeout(resolve, ms));

// Add 1 second delay between API calls
await delay(1000);

const searchQuery = $json.searchQueries;
const apiKey = $('Set Search Parameters').item.json.youtubeApiKey;
const maxResults = $('Set Search Parameters').item.json.maxResults;

// Return the search parameters for the HTTP request
return {
  searchQuery,
  apiKey,
  maxResults,
  delayApplied: true
};

// Enhanced video data processing with error handling
try {
  const videoData = $input.last().json.items?.[0];
  const searchQuery = $('Split Search Queries').item.json;

  if (!videoData) {
    console.log('No video data found, skipping...');
    return null;
  }

  // Safe parsing with fallbacks
  function parseDuration(duration) {
    try {
      const match = duration.match(/PT(\d+H)?(\d+M)?(\d+S)?/);
      const hours = (match[1] ? parseInt(match[1]) : 0);
      const minutes = (match[2] ? parseInt(match[2]) : 0);
      const seconds = (match[3] ? parseInt(match[3]) : 0);
      return `${hours ? hours + 'h ' : ''}${minutes}m ${seconds}s`;
    } catch (error) {
      return 'Unknown duration';
    }
  }

  // Safe number parsing
  const safeParseInt = (value, fallback = 0) => {
    const parsed = parseInt(value);
    return isNaN(parsed) ? fallback : parsed;
  };

  // Calculate engagement metrics
  const views = safeParseInt(videoData.statistics?.viewCount);
  const likes = safeParseInt(videoData.statistics?.likeCount);
  const comments = safeParseInt(videoData.statistics?.commentCount);
  const engagementRate = views > 0 ? ((likes + comments) / views * 100).toFixed(2) : 0;

  // Enhanced relevance scoring
  let relevanceScore = 'low';
  if (views > 10000 && parseFloat(engagementRate) > 2) relevanceScore = 'high';
  else if (views > 1000 && parseFloat(engagementRate) > 1) relevanceScore = 'medium';

  return {
    video_id: videoData.id,
    title: videoData.snippet?.title || 'Unknown Title',
    channel_title: videoData.snippet?.channelTitle || 'Unknown Channel',
    channel_id: videoData.snippet?.channelId || '',
    description: (videoData.snippet?.description || '').substring(0, 500) + '...',
    published_at: videoData.snippet?.publishedAt || '',
    view_count: views,
    like_count: likes,
    comment_count: comments,
    duration: parseDuration(videoData.contentDetails?.duration || 'PT0S'),
    duration_raw: videoData.contentDetails?.duration || '',
    tags: (videoData.snippet?.tags || []).join(', '),
    thumbnail_url: videoData.snippet?.thumbnails?.medium?.url || videoData.snippet?.thumbnails?.default?.url || '',
    video_url: `https://www.youtube.com/watch?v=${videoData.id}`,
    channel_url: `https://www.youtube.com/channel/${videoData.snippet?.channelId || ''}`,
    search_query: searchQuery?.searchQueries || '',
    engagement_rate: parseFloat(engagementRate),
    scraped_at: new Date().toISOString(),
    category: 'n8n_automation',
    relevance_score: relevanceScore,
    processing_status: 'pending_review'
  };
} catch (error) {
  console.error('Error processing video data:', error);
  return {
    error: 'Processing failed',
    error_details: error.message,
    scraped_at: new Date().toISOString()
  };
}

// Collect all valid videos for batch processing
const allVideos = $input.all();

if (allVideos.length === 0) {
  console.log('No videos to process');
  return [{ json: { message: 'No new videos found', video_count: 0 } }];
}

// Sort videos by engagement and views for prioritization
const sortedVideos = allVideos
  .map(item => item.json)
  .filter(video => video && video.title && !video.error)
  .sort((a, b) => {
    const scoreA = (a.view_count * 0.7) + (a.engagement_rate * 0.3);
    const scoreB = (b.view_count * 0.7) + (b.engagement_rate * 0.3);
    return scoreB - scoreA;
  });

console.log(`Processing ${sortedVideos.length} quality videos`);

// Prepare data for batch operations
return {
  videos: sortedVideos,
  video_count: sortedVideos.length,
  processing_timestamp: new Date().toISOString(),
  batch_id: `batch_${Date.now()}`
};

// Prepare comprehensive analysis data for AI
const videosData = $json.videos;

if (!videosData || videosData.length === 0) {
  return { message: 'No videos to analyze', analysis_skipped: true };
}

// Extract top performing videos (limit to top 15 for AI analysis)
const topVideos = videosData.slice(0, 15).map(video => ({
  title: video.title,
  channel: video.channel_title,
  views: video.view_count,
  likes: video.like_count,
  comments: video.comment_count,
  engagement_rate: video.engagement_rate,
  duration: video.duration,
  search_query: video.search_query,
  tags: video.tags,
  relevance_score: video.relevance_score
}));

// Extract trending keywords from titles
const allTitles = videosData
  .map(v => v.title?.toLowerCase() || '')
  .filter(title => title.length > 0)
  .join(' ');

const words = allTitles.split(/\W+/).filter(word => word.length > 3);
const wordCount = {};
words.forEach(word => {
  wordCount[word] = (wordCount[word] || 0) + 1;
});

const trendingKeywords = Object.entries(wordCount)
  .sort(([,a], [,b]) => b - a)
  .slice(0, 20)
  .map(([word, count]) => ({ word, count }));

// Channel performance analysis
const channelStats = {};
videosData.forEach(video => {
  const channel = video.channel_title || 'Unknown Channel';
  if (!channelStats[channel]) {
    channelStats[channel] = {
      videos: 0,
      total_views: 0,
      total_engagement: 0
    };
  }
  channelStats[channel].videos++;
  channelStats[channel].total_views += video.view_count || 0;
  channelStats[channel].total_engagement += video.engagement_rate || 0;
});

const topChannels = Object.entries(channelStats)
  .map(([name, stats]) => ({
    channel_name: name,
    video_count: stats.videos,
    avg_views: Math.round(stats.total_views / stats.videos),
    avg_engagement: (stats.total_engagement / stats.videos).toFixed(2)
  }))
  .sort((a, b) => b.avg_views - a.avg_views)
  .slice(0, 8);

const analysis = {
  total_videos_found: videosData.length,
  analysis_date: new Date().toISOString(),
  top_performing_videos: topVideos,
  trending_keywords: trendingKeywords,
  top_channels: topChannels,
  average_views: Math.round(videosData.reduce((sum, v) => sum + (v.view_count || 0), 0) / videosData.length),
  average_engagement: (videosData.reduce((sum, v) => sum + (v.engagement_rate || 0), 0) / videosData.length).toFixed(2),
  search_queries_used: [...new Set(videosData.map(v => v.search_query || '').filter(q => q.length > 0))],
  batch_id: $('Collect Videos for Batch Processing').item.json.batch_id
};

return {
  n8n_video_analysis: JSON.stringify(analysis, null, 2),
  video_count: videosData.length,
  analysis_ready: true
};

// Parse and structure AI analysis results for Google Sheets
const aiResponse = $input.first().json.output;
const videosData = $('Collect Videos for Batch Processing').first().json.videos;
const batchId = $('Collect Videos for Batch Processing').first().json.batch_id;

try {
  // Extract headlines from AI response
  const headlineMatches = aiResponse.match(/### 4\. VIRAL HEADLINES[\s\S]*?(?=###|$)/i) || 
                         aiResponse.match(/VIRAL HEADLINES[\s\S]*?(?=###|$)/i);
  const headlines = [];
  if (headlineMatches) {
    const headlineSection = headlineMatches[0];
    const headlinePattern = /\d+\. (.+)/g;
    let match;
    while ((match = headlinePattern.exec(headlineSection)) !== null) {
      headlines.push({
        headline: match[1].trim(),
        created_at: new Date().toISOString(),
        batch_id: batchId
      });
    }
  }

  // Extract workflow recommendations
  const workflowMatches = aiResponse.match(/### 5\. WORKFLOW TOPIC RECOMMENDATIONS[\s\S]*?(?=###|$)/i) ||
                         aiResponse.match(/WORKFLOW TOPIC RECOMMENDATIONS[\s\S]*?(?=###|$)/i);
  const workflows = [];
  if (workflowMatches) {
    const workflowSection = workflowMatches[0];
    const workflowPattern = /\d+\. \*\*Workflow\*\*: (.+?) \| \*\*Why it works\*\*: (.+?) \| \*\*Keywords\*\*: (.+)/g;
    let match;
    while ((match = workflowPattern.exec(workflowSection)) !== null) {
      workflows.push({
        workflow: match[1].trim(),
        reasoning: match[2].trim(),
        keywords: match[3].trim(),
        created_at: new Date().toISOString(),
        batch_id: batchId
      });
    }
  }

  // Prepare structured data for Google Sheets
  const sheets_data = {
    // Raw video data for main videos sheet
    videos: videosData.map(video => ({
      'Video ID': video.video_id,
      'Title': video.title,
      'Channel': video.channel_title,
      'View Count': video.view_count,
      'Like Count': video.like_count,
      'Comment Count': video.comment_count,
      'Engagement Rate': video.engagement_rate,
      'Duration': video.duration,
      'Video URL': video.video_url,
      'Channel URL': video.channel_url,
      'Search Query': video.search_query,
      'Relevance Score': video.relevance_score,
      'Scraped At': video.scraped_at,
      'Batch ID': batchId,
      'Processing Status': 'analyzed'
    })),

    // AI-generated headlines
    headlines: headlines.map(h => ({
      'Headline': h.headline,
      'Created At': h.created_at,
      'Batch ID': h.batch_id,
      'Category': 'n8n_automation'
    })),

    // AI-generated workflow topics
    workflows: workflows.map(w => ({
      'Workflow': w.workflow,
      'Reasoning': w.reasoning,
      'Keywords': w.keywords,
      'Created At': w.created_at,
      'Batch ID': w.batch_id,
      'Category': 'content_idea'
    })),

    // Summary analysis
    summary: [{
      'AI Analysis': aiResponse,
      'Videos Processed': videosData.length,
      'Headlines Generated': headlines.length,
      'Workflows Generated': workflows.length,
      'Analysis Date': new Date().toISOString(),
      'Batch ID': batchId,
      'Status': 'completed'
    }]
  };

  console.log(`‚úÖ Parsed AI results: ${headlines.length} headlines, ${workflows.length} workflows`);

  return {
    ai_analysis_complete: aiResponse,
    sheets_data: sheets_data,
    batch_id: batchId,
    parsing_successful: true,
    ready_for_sheets: true
  };

} catch (error) {
  console.error('Error parsing AI response:', error);
  return {
    ai_analysis_complete: aiResponse,
    error: 'Parsing failed',
    error_details: error.message,
    batch_id: batchId,
    parsing_successful: false
  };
}

// Final workflow completion summary
const parsedResults = $('Parse & Structure AI Results').first().json;
const batchId = parsedResults.batch_id;
const sheetsData = parsedResults.sheets_data;

const summary = {
  workflow_status: 'completed',
  batch_id: batchId,
  execution_time: new Date().toISOString(),

  // Data processing results
  videos_processed: sheetsData?.videos?.length || 0,
  headlines_generated: sheetsData?.headlines?.length || 0,
  workflows_generated: sheetsData?.workflows?.length || 0,

  // Next scheduled run
  next_run: new Date(Date.now() + 4 * 60 * 60 * 1000).toISOString(),

  // Operation summary
  operations_completed: [
    'YouTube data collection',
    'Video quality filtering',
    'AI content analysis',
    'Results parsing',
    'Data preparation for Google Sheets'
  ],

  // Ready for manual Google Sheets upload
  ready_for_sheets_upload: true,
  sheets_data_available: !!sheetsData
};

// Console logging for monitoring
console.log('üéâ N8N YouTube Scraper Workflow Completed Successfully!');
console.log(`üìä Batch ID: ${batchId}`);
console.log(`üé• Videos Processed: ${summary.videos_processed}`);
console.log(`üí° Headlines Generated: ${summary.headlines_generated}`);
console.log(`‚öôÔ∏è Workflows Generated: ${summary.workflows_generated}`);
console.log(`üîÑ Next Run: ${summary.next_run}`);
console.log('üìù Data ready for Google Sheets upload!');

return summary;
